import React from 'react';
import s from './ProfileInfo.module.css';
import Preloader from '../../../components/common/Preloader/preloader';
import photo from './../../../assets/images/Inst.png';
import styles from "./ProfileInfo.module.css";
import Phot from './../../../assets/images/user.png';

const ProfileInfo = (props) => {
    if(!props.profile){
        return <Preloader />
    }

    return (
        <div>
            <div>
                < img src="https://images.pexels.com/photos/248797/pexels-photo-248797.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" />
            </div>
            <div className={s.descriptionBlock}>
                <img src={props.profile.photos.large != null ? props.profile.photos.large : Phot} className={styles.userPhoto} />
            </div>
            <div >{props.profile.contacts.facebook}</div>
            <div>{props.profile.contacts.vk}</div>
            <div>{props.profile.contacts.twitter}</div>
            <div><img src={photo} className={s.photos}/>{props.profile.contacts.instagram}</div>
        </div>
    )
}

export default ProfileInfo;
